import React from 'react';

import { Jumbotron, Button, OverlayTrigger, Popover } from 'react-bootstrap';

import Footer from '../Footer';

import "../css/Services.css";
import '../../App.css';


const Services = () => {
  return (
  	<>
  		<ServiceContent />
  		<Footer />
  	</>
  );
}

const popover = (
  <Popover id="popover-basic">
    <Popover.Title as="h3">Popover right</Popover.Title>
    <Popover.Content>
      And here's some <strong>amazing</strong> content. It's very engaging.
      right?
    </Popover.Content>
  </Popover>
);

const ServiceContent = () => {
	return (
		<>
			<div className="contentContainer">
				<Jumbotron>
	  				<h1>SERVICES</h1>
				    <p>
				    	We handle each project with great care and treat customer with the time and attention theu deserve. If the service you requested in not listed on this page, you can <OverlayTrigger trigger="hover" placement="right" overlay={popover}><span className="contactLink">contact</span></OverlayTrigger> us to maek ararngements.
				    </p>

	  				<p>
	    				<Button variant="primary">Make it Happen</Button>
	  				</p>
				</Jumbotron>
			</div>
		</>
	)
}

export default Services;
